import React from 'react'

class square extends React.Component{

    constructor(props)
    {
        super(props);
        this.state={
            value:null,
        };

    }
    render(){
        return (
            <div onClick={() => {this.setState({value: 'X'})}}>
                <button>{this.state.value}</button>
            </div>
        )
    }
}
export default square
